import './App.scss';
import Comp2 from './Component/Comp2';
import Comp1 from './Component/Comp1';
import Nav from './Component/Nav';
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <div>
        <Nav/>
        <Routes>

          <Route path='/comp1'>
            <Comp1 />
          </Route>

          <Route path='/comp2'>
            <Comp2 />
          </Route>

        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
